import React from 'react';
import './dashboard.css';
// import ExpenseTracker from '../expense/expense_tracker';
// import PieChartComponent from './Dashboard/piechart';
// import TotalBudget from './Dashboard/total_budget';
// import UpcomingBills from './Dashboard/upcoming_bills';

const Dashboard = ({ }) => {

    return (
        <div className="dashboard">
            <div className="dashboard-container">
                <div className="dashboard-grid">
                    <DashboardBox title="Expense Tracker" navigateTo="/expense-tracker" />
                    <DashboardBox title="Budget" navigateTo="/budget" />
                    <DashboardBox title="Analytics" navigateTo="/analytics" />
                    <DashboardBox title="Upcoming Bills" navigateTo="/upcoming-bills" />
                </div>
            </div>
        </div>
    )
}

export default Dashboard;
